import React from "react";

const Skill = (props) => {
  let tempSkills = [];
  const handleSkills = (event) => {
    tempSkills.push(event.target.innerText);
  };
  return <div onClick={() => handleSkills(event)}>{props.name}</div>;
};

export default Skill;
